export default function ChangePassword() {

    return (
    <body className="register">
    <h1>Join ABC </h1>
    <form onSubmit={handleSubmit}>
    <div style={{ paddingBottom: "20px" }}>
            <label>
                Password:
            <input
              onChange={(event) => {
                setUser({
                  ...user,
                  u_pwd: event.target.value,
                });
              }}
              type="password"
              required
              minLength="8"
              name="u_pwd"
            />
            (8 Characters min)
          </label>
        </div>
    </form>
    </body>
    )
}
